webpackJsonp([202],{"./node_modules/json-loader/index.js!./.cache/json/articles-python-python-boolx-function.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p><code>bool()</code> is a built-in function in Python 3. This function returns a Boolean value, i.e. True or False. It takes one argument, <code>x</code>.</p>\n<h2>Arguments</h2>\n<p>It takes one argument, <code>x</code>. <code>x</code> is converted using the standard <a href="https://docs.python.org/3/library/stdtypes.html#truth">Truth Testing Procedure</a>.</p>\n<h2>Return Value</h2>\n<p>If <code>x</code> is false or omitted, this returns <code>False</code>; otherwise it returns <code>True</code>.</p>\n<h2>Code Sample</h2>\n<pre><code>print(bool(4 > 2)) # Returns True as 4 is greater than 2\nprint(bool(4 &#x3C; 2)) # Returns False as 4 is not less than 2\nprint(bool(4 == 4)) # Returns True as 4 is equal to 4\nprint(bool(4 != 4)) # Returns False as 4 is equal to 4 so inequality doesn\'t holds\nprint(bool(4)) # Returns True as 4 is a non-zero value\nprint(bool(-4)) # Returns True as -4 is a non-zero value\nprint(bool(0)) # Returns False as it is a zero value\nprint(bool(\'dskl\')) # Returns True as the string is a non-zero value\nprint(bool([1, 2, 3])) # Returns True as the list is a non-zero value\nprint(bool((2,3,4))) # Returns True as tuple is a non-zero value\nprint(bool([])) # Returns False as list is empty and equal to 0 according to truth value testing\n</code></pre>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/CVCS/2">Run Code</a></p>\n<p><a href="https://docs.python.org/3/library/functions.html#bool">Official Docs</a></p>',frontmatter:{title:"Python Boolx Function",parent:"/home/stuart/guides/src/pages/articles/python/python-boolx-function/index.md absPath of file"}}},pathContext:{slug:"/articles/python/python-boolx-function/"}}}});
